import { IComponentData } from "../../interfaces/icomponent_data";
import { IComponentSerialize } from "../../interfaces/icomponent_serialize";
import { IComponentDeserialize } from "../../interfaces/icomponent_deserialize";
import { Vector2 } from "../../../../../../utility/math_extended/vector2";

export class TransformData implements IComponentData, IComponentSerialize, IComponentDeserialize{

    public name: string;
    public position: Vector2;
    public rotation: number;
    public scale: Vector2;
    public localPosition!: Vector2;
    public localRotation!: number;
    public localScale!: Vector2;
    public hierarchyCount!: number;
    public hierarchyCapacity!: number;

    constructor(name: string, position: Vector2 = new Vector2(0,0), rotation: number = 0, scale: Vector2 = new Vector2(1,1)){
        this.name = name;
        this.position = position;
        this.rotation = rotation;
        this.scale = scale;

        this.hierarchyCapacity = 0;
        this.hierarchyCount = 0;
    }

    Serialize(): Map<string, string> {
        let data: Map<string, string> = new Map();
        data.set("position", this.position.toString());
        data.set("rotation", this.rotation.toString());
        data.set("scale", this.scale.toString());
        data.set("localPosition", this.localPosition.toString())
        data.set("localRotation", this.localRotation.toString());
        data.set("localScale", this.localScale.toString())
        data.set("hierarchyCount", this.hierarchyCount.toString());
        data.set("hierarchyCapacity", this.hierarchyCapacity.toString());
        return data;
    }

    Deserialize(data: Map<string, string>): void {
        this.position.fromString(data.get("position")!);
        this.rotation = parseFloat(data.get("rotation")!);
        this.scale.fromString(data.get("scale")!);
        this.localPosition.fromString(data.get("localPosition")!);
        this.localRotation = parseFloat(data.get("localRotation")!);
        this.localScale.fromString(data.get("localScale")!);        
        this.hierarchyCount = parseFloat(data.get("hierarchyCount")!);
        this.hierarchyCapacity = parseFloat(data.get("hierarchyCapacity")!);
    }

    GetCopy(): TransformData {
        let dataCopy: TransformData = new TransformData(this.name);
        dataCopy.position = this.position;
        dataCopy.rotation = this.rotation;
        dataCopy.scale = this.scale;
        dataCopy.localPosition = this.localPosition;
        dataCopy.localRotation = this.localRotation;
        dataCopy.localScale = this.localScale;
        dataCopy.hierarchyCount = this.hierarchyCount;
        dataCopy.hierarchyCapacity = this.hierarchyCapacity;
        return dataCopy;
    }
}
